import base64, lzma, pickle
CROM = b''
ROM, index = pickle.loads(lzma.decompress(base64.b64decode(CROM)))
N = len(ROM)

COL = '\x1b[1;36m'
NOCOL = '\x1b[0m'

def getContext(s, a, count, wpos):
  l = 0
  u = N
  m = -1
  while l < u:
    m = (l+u)//2
    word = ROM[str(m+1)]
    if s < word['surah'] or (s==word['surah'] and a <= word['ayah']):
      u = m
    else:
      l = m+1
  start = u
  end = u

  while True:
    if start == 0: break
    word = ROM[str(start)]
    if s==word['surah'] and a==word['ayah']:
      start = start-1
    else:
      break

  while True:
    if end == N: break
    word = ROM[str(end+2)]
    end = end+1
    if s!=word['surah'] or a!=word['ayah']:
      break

  if start+count >= end:
    l = start
    u = end
  elif wpos<count//2:
    l = start
    u = l + count
  elif start+wpos+count//2>=end:
    u = end
    l = u - count
  else:
    l = start + wpos - count//2
    u = l + count

  arabic = ''
  translit = ''
  english = ''

  for i in range(l, u):
    word = ROM[str(i+1)]
    if i > l:
      arabic += ' '
      translit += ' _ '
      english += ' _ '
    if i==start+wpos:
      arabic += COL
      translit += COL
      english += COL
    arabic += word['arabic']
    translit += word['translit']
    english += word['english']
    if i==start+wpos:
      arabic += NOCOL
      translit += NOCOL
      english += NOCOL
  return arabic, translit, english

import time
word = ROM[str(1+index[int(0+int(time.time())/(6*3600))%N])]
arabic, translit, english = getContext(word['surah'], word['ayah'], 5, word['position'])
print()
print(' ', arabic)
print()
print(' ', translit, '', str(word['surah'])+':'+str(word['ayah']))
print(' ', english)

